  `id` int(11) NOT NULL AUTO_INCREMENT,
  `brandid` int(11) DEFAULT NULL,
  `ageseasonid` int(11) DEFAULT NULL,
  `brandgroupid` int(11) DEFAULT NULL,
  `rate` float(6,2) DEFAULT NULL,
  `modifystaff` int(11) DEFAULT NULL,
  `modifytime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `brandid` (`brandid`,`ageseasonid`,`brandgroupid`)
