/*Table structure for table `tb_exchange_rate` */

DROP TABLE IF EXISTS `tb_exchange_rate`;

CREATE TABLE `tb_exchange_rate` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `currency_from` int(11) DEFAULT NULL,
  `currency_to` int(11) DEFAULT NULL,
  `rate` decimal(10,3) DEFAULT NULL,
  `companyid` int(11) DEFAULT NULL,
  `begin_time` datetime DEFAULT NULL,
  `end_time` datetime DEFAULT NULL,
  `status` tinyint(4) DEFAULT NULL COMMENT '1=历史汇率；0=当前汇率',
  PRIMARY KEY (`id`),
  KEY `currency_from` (`companyid`,`currency_from`,`currency_to`,`status`,`begin_time`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4;

