/*Table structure for table `tb_price` */

DROP TABLE IF EXISTS `tb_price`;

CREATE TABLE `tb_price` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `countryid` int(11) DEFAULT NULL,
  `pricetype` tinyint(4) DEFAULT NULL COMMENT '1=零售价；2=批发价；3=一口价',
  `currencyid` int(11) DEFAULT NULL COMMENT '货币',
  `companyid` int(11) DEFAULT NULL,
  `name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '价格名称',
  `displayindex` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `companyid` (`companyid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

