/*Table structure for table `tb_price_setting` */

DROP TABLE IF EXISTS `tb_price_setting`;

CREATE TABLE `tb_price_setting` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `companyid` int(11) DEFAULT NULL,
  `brandid` int(11) DEFAULT NULL,
  `brandgroupid` int(11) DEFAULT NULL,
  `brandgroupchildid` int(11) DEFAULT NULL,
  `ageseasonid` int(11) DEFAULT NULL,
  `seriesid` int(11) DEFAULT NULL,
  `discount` float(10,2) DEFAULT NULL COMMENT '倍率',
  `sort_value` char(60) COLLATE utf8_bin DEFAULT NULL,
  `priceid` int(11) DEFAULT NULL COMMENT '价格id',
  `filter` tinyint(11) DEFAULT NULL COMMENT '1=个位取整；2=十位取整；3=不取整',
  PRIMARY KEY (`id`),
  UNIQUE KEY `companyid` (`companyid`,`priceid`,`brandid`,`brandgroupid`,`brandgroupchildid`,`ageseasonid`,`seriesid`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

